import React, { useState } from 'react';
import Layout from '../components/Layout';
import styles from './styles/EditMovie.module.css';  // Import the CSS file

function EditMovie() {
  const [movieTitle, setMovieTitle] = useState('The Dark Knight');
  const [director, setDirector] = useState('Christopher Nolan');
  const [imageUrl, setImageUrl] = useState('https://image.tmdb.org/t/p/w500/qJ2tW6WMUDux911r6m7haRef0WH.jpg');
  const [description, setDescription] = useState('Batman raises the stakes in his war on crime.');
  const [genre, setGenre] = useState('Action');
  const [year, setYear] = useState(2008);

  const handleEditMovie = (e) => {
    e.preventDefault();
    console.log("Movie Edited:", { movieTitle, director, imageUrl, description, genre, year });
  };

  return (
    <Layout>
      <div className="container">
        <div className="formContainer">
          <h1 className="header">Edit Movie</h1>
          <form onSubmit={handleEditMovie} className="form">
            <div className="formGroup">
              <label className="label">Movie Title</label>
              <input 
                type="text" 
                value={movieTitle} 
                onChange={(e) => setMovieTitle(e.target.value)} 
                className="input"
                required 
              />
            </div>
            <div className="formGroup">
              <label className="label">Director</label>
              <input 
                type="text" 
                value={director} 
                onChange={(e) => setDirector(e.target.value)} 
                className="input"
                required 
              />
            </div>
            <div className="formGroup">
              <label className="label">Image URL</label>
              <input 
                type="text" 
                value={imageUrl} 
                onChange={(e) => setImageUrl(e.target.value)} 
                className="input"
                required 
              />
            </div>
            <div className="formGroup">
              <label className="label">Description</label>
              <textarea 
                value={description} 
                onChange={(e) => setDescription(e.target.value)} 
                className="textarea"
                required 
              />
            </div>
            <div className="formGroup">
              <label className="label">Genre</label>
              <input 
                type="text" 
                value={genre} 
                onChange={(e) => setGenre(e.target.value)} 
                className="input"
                required 
              />
            </div>
            <div className="formGroup">
              <label className="label">Year</label>
              <input 
                type="number" 
                value={year} 
                onChange={(e) => setYear(e.target.value)} 
                className="input"
                required 
              />
            </div>
            <button type="submit" className="button">Save Changes</button>
          </form>
        </div>

        <div className="movieDetails">
          <h2 className="detailsHeader">Current Movie Info</h2>
          <img 
            src={imageUrl} 
            alt={movieTitle} 
            className="poster"
          />
          <p><strong>Title:</strong> {movieTitle}</p>
          <p><strong>Director:</strong> {director}</p>
          <p><strong>Genre:</strong> {genre}</p>
          <p><strong>Year:</strong> {year}</p>
          <p><strong>Description:</strong> {description}</p>
        </div>
      </div>
    </Layout>
  );
}

export default EditMovie;
